// reducers/navBarReducer.js

const initialState = {
    isLeftNavBarVisible: false,
  };
  
  const navBarReducer = (state = initialState, action) => {
    switch (action.type) {
      case 'TOGGLE_NAVBAR':
        return {
          ...state,
          isLeftNavBarVisible: !state.isLeftNavBarVisible,
        };
      default:
        return state;
    }
  };
  
  export default navBarReducer;
